</head>
<style>
	/*  隐藏 html 里的注释*/
	.hidden
	{
		display:none
	}
	
	/* 全局设置 ------------------------- */
	body
	{
		align-content:center;
	}
	div.topArea,div.inputArea,div.hintArea,div.resultArea
	{
		background-color:rgba(230,230,230,0.57);
		width:80%;
		margin-left:10%;
		margin-right:10%;
		align-content:center;
	}
	
	/* 顶部区域 ------------------------- */
	div.topArea
	{
		background-color:rgba(0,0,0,0);
	}
	div.topArea div
	{
		display:inline-flex;
		margin-top:7.7%;
		margin-left:-2%;
	}
	div.topArea div font
	{
		font-size:47px;
		font-weight:600;
		color:rgba(21,21,21,0.5);
		text-align:center;
		display:block;
	}
	
	/* 输入区域 ------------------------- */
	div.inputArea
	{	
		margin-top:3.5%;
		background-color:rgba(230,230,230,0);
	}
	div.inputArea div
	{
		display:inline-flex;
		margin-left:8%;
	}
	div.inputArea div #ip_di
	{
		display: inline-block;
		background-color: rgba(250,250,250,0.2);
		border: solid 2px rgba(186,186,186,0.57);
		border-right:none;
		border-top-left-radius: 18px;
		border-bottom-left-radius: 18px;
		padding: 8px;
		box-sizing: border-box;
		outline:none;
		font-size: 30px;
		font-weight:550;
		color:rgba(79,79,79,0.65);
	}
	div.inputArea div  #ip_di::-webkit-input-placeholder
	{
		/* 修改输入框的提示文字的颜色 */
		color:rgba(165,165,165,0.35);
	}
	div.inputArea div #bt_query
	{
		display:inline-block;
		background-color: rgba(250,250,250,0.2);
		background-repeat:no-repeat;
		background-size:contain;
		background-position:center;
		border: solid 2px rgba(186,186,186,0.57);
		border-top-right-radius: 18px;
		border-bottom-right-radius: 18px;
		border-left:none;
		padding: 8px;
		padding-right:50px;
		width:40px;
		outline:none;
		text-align:center;
		font-size:25px;
	}
	div.inputArea>div:hover>#bt_query
	{
		background-color: rgba(250,250,250,0.30);
		border: solid 5px rgba(100,100,100,0.35);
		border-left:none;
	}

<script>
	var ip_di;
	var bt_query;
	var ta_hint;
	var tb_resultTable;
	
	$(document).ready(function(){
		//测试
		
		//初始化变量
		initValue();
		
		//初始化监听事件
		initElementCallback();
		
	});
	
	//初始化变量
	function initValue(){
		ip_di=$("#ip_di");
		bt_query=$("#bt_query");
		ta_hint=$("#ta_hint");
		tb_resultTable=$("table#resultTable");
	};
	
	//初始化监听事件
	function initElementCallback(){
		//输入框为空就隐藏结果显示区域
		ip_di.keyup(ip_di_onKeyUpListener);
		
		//绑定查询按钮监听事件
		bt_query.click(bt_query_onClickListener);
		
		//相应全局按键事件
		$(document).keyup(d_enter_onKeyPressListener);
	};
	
	//全局相应 enter 键监听
	function d_enter_onKeyPressListener(event){
		if (event.which==13) bt_query.click();
	}
	
	//输入框的内容变化监听
	function ip_di_onKeyUpListener(){
		ta_hint.hide();
	}
	
	//查询按钮的点击监听
	function bt_query_onClickListener(){
		var di;
		//获取 input 控件的内容（要查询的数据标签）并去除空格和转为小写字符
		di=ip_di.val();
		di=di.replace(/\s/g,"");
		if (di.length!=8){
			ta_hint.text("数据标识长度错误，正常输入为 4 字节 8 字符");
			ta_hint.show();
			tb_resultTable.hide();
			return false;
		}
		di=di.toLowerCase();
		if(!/^[a-z,0-9]{8}$/.test(di)){
			ta_hint.text("输入的内容含有非法字符。正确字符范围：A-Z，a-z，0-9");
			ta_hint.show();
			tb_resultTable.hide();
			return false;
		}
		//将输入的数据标签转为 4 字节 16 进制数并作减 33 处理
		var di0,di1,di2,di3;
		di0=parseInt(di.substr(0,2),16);
		di1=parseInt(di.substr(2,2),16);
		di2=parseInt(di.substr(4,2),16);
		di3=parseInt(di.substr(6,2),16);
		di0-=0x33;
		di1-=0x33;
		di2-=0x33;
		di3-=0x33;
		di0&=0xff;
		di1&=0xff;
		di2&=0xff;
		di3&=0xff;
		di0=formatHex(di0.toString(16));
		di1=formatHex(di1.toString(16));
		di2=formatHex(di2.toString(16));
		di3=formatHex(di3.toString(16));
		//拼凑 4 各字节并查询数据标签的具体内容
		di=di3+di2+di1+di0;
		//先情况旧表格内容在生成新表格内容，然后显示表格内容
		var protocol_645_13="645_13";
		var record=database.getRecord(protocol_645_13,di);
		if (record==null){
			ta_hint.text("在协议中找不到对应的数据标识");
			ta_hint.show();
			tb_resultTable.hide();
			return false;
		}
		var tb_tbody_tr;
		var tb_tbody_tr_content;
		$("tbody#tb_tbody tr td").remove();
		tb_tbody_tr=$("tbody#tb_tbody tr");
		tb_tbody_tr_content=createTableLineContent(record);
		tb_tbody_tr.html(tb_tbody_tr_content);
		tb_resultTable.show();
		return false;
	}
	
	//格式化 16 进制数的格式
	function formatHex(hexString){
		if (hexString.length<2) hexString='0'+hexString;
		return hexString;
	}
	
	//生成表格记录
	function createTableLineContent(record){
		var i=0;
		var tmp="";
		var result="";
		function formatTdContent(data){
			if (i<4){
				tmp=parseInt(data,16);
				tmp+=0x33;
				tmp&=0xff;
				tmp=tmp.toString(16);
				tmp=formatHex(tmp);
				tmp=tmp.toUpperCase();
				data=data+"<br/>("+"<label class=\"di33\">"+tmp+"</label>)";
				i++;
			}
			return "<td>"+data+"</td>";
		};
		for (var t in record) result+=formatTdContent(record[t]);
		return result;
	}
</script>
